import React, { useState } from "react";
function App() {
  let [myNumber, setMyNumber] = useState(0);
  const increamentNumber = function () {
    let myNum = myNumber++;
    setMyNumber(myNum);
  };
  return (
    <div>
      <button onClick={increamentNumber}>increament</button>
      <label>{myNumber}</label>
    </div>
  );
}

export default App;
